import React, { useEffect, useState } from "react";
import "../Css/NavPanel.css";
import { Link } from "react-router-dom";

const NavPanel = () => {
  return (
    <div className="nav-section">
      <div>User Name</div>
      <Link to="/add_gsm" className="nav-link">
        Add GSM
      </Link>
      <Link to="/add_shade" className="nav-link">
        Add Shade
      </Link>
      <Link to="/add_high_defects" className="nav-link">
        No of High Defects
      </Link>
      <Link to="/pass_fail_status" className="nav-link">
        Pass Fail Status
      </Link>
      <Link to="/batch_status" className="nav-link">
        Batch Status
      </Link>
      <Link to="/reports" className="nav-link">
        Report
      </Link>
    </div>
  );
};

export default NavPanel;
